import styled from 'styled-components';

import Nav from './Nav';
import Contents from './Contents';
import Details from './Details';

const Container = styled.div`
    display: flex;
    width: 100%;
    height: calc(100vh - 2px);
    margin: 0;
    padding: 0;
`

class List extends Component {
    state = {  }
    render() { 
        return (
            <Container>
                <Nav />
                <Contents />
                <Details />
            </Container>
        );
    }
}
 
export default List;
